import React from "react";

function Search() {
  return (
    <div className="search-container">
      <div className="input-group rounded-circle bg-dark">
        <input
          type="search"
          className="form-control rounded-circle search-input text-white"
          placeholder="Search"
          aria-label="Search"
          aria-describedby="search-addon"
        />
      </div>
    </div>
  );
}

export default Search;
